import {useState,use} from 'react'
import PhonebookContext from './PhonebookContext'

function ViewUpdates() {
    const { phones } = useContext(PhonebookContext);
    return (
        <div>
            {
                phones.map(phone => (
                    <div>{phone.name} - {phone.number}</div>
                ))
            }
        </div>
    )
}

export default ViewUpdates
